"12\" cy=\"12\" r=\"1\" />\r\n                <circle cx=\"19\" cy=\"12\" r=\"1\" />\r\n                <circle cx=\"5\" cy=\"12\" r=\"1\" />\r\n              </g>\r\n            </svg>\r\n            <span>More</span>\r\n          </SidebarMenuButton>\r\n        </SidebarMenuItem>\r\n      </SidebarMenu>\r\n    </SidebarGroup>\r\n  )\r\n}\r\n\r\nexport default NavProjects\r\n"
